يلة السائدة في مجتمعنا الكريم والتي أستهدف أن نتمثلها جميعاً في رحلتنا على أديم الأرض.
احرص على أن تجعل كل يوم رائعتك، وإذا سقطت وترديت أثناء سعيك في المضمار، فارفع نفسك عن الأرض، وانفِّض عنك ما علق بك، من الأتربة، والغبار، وابدأ من جديد في الركض، مرة أخرى، ولا تسمح للحصان الذي تمتطيه بأن يكُّف عن الصهيل، والركض. 
ما أحلى أن يتعامل الإنسان مع المِحَّن، على أنها مِنَّح، والتجارب الفاشلة، على أنها فُرَّص للتعَّلُم، والاستزادة من المعرفة، والخبرة، لا مزالق إلى الفشل، ما أحلى أن يعتقد في قرارة نفسه أنه مخلوق عظيم، ومميَّز، ومختلِّف، له رسالة في الحياة، وأهداف سامية، ومقاصد نبيلة، يعيش لتحقيقها، يبتعد عن الشعور بالحزن، والكآبة، واليأس، وفقدان الأمل، يشغل نفسه بمعالي الأمور، ويترفَّع عن الانشغال بسفسافها، يُلزِّم نفسه بالتوقف عن البحث عن أخطاء الناس، ومعايبهم، يُجالِّس المتفائلين، والخيِّرين، ويبتعِّد، بل يفر فِّراره من الوحوش المفترسة عن مجالسة المتشائمين اليائسين المُحبَطين.
يُقال أن: "فاقد الشيء، لا يُعطيه"، ولذا ينبغي على الإنسان أن يبدأ بحب ذاته، ذلك أن صُلب علاقاته بالآخرين هو علاقته بذاته، وحبِّه لها يُعَّد شرطاً لازماً لإيجاد رابطة حب حقيقية تجمعه بآخرين، أسرة كانوا، أم أصدقاء، أو تجمعه بهم علاقات حب، أو عمل، أو مصلحة من مصالح الحياة المتنوعة ، والمركز الذي يولِّد حب الذات هو نفس المكان الذي يجذِّب حب الآخرين إليه، فإذا كان هذا المركز مُلبَّداً بالغيوم، مُلطخاً بالأوحال، فإن قدرته على جذب علاقات تتلألأ بالسحر من فرط الحب، ستكون غير كاملة.

