3-عمل ابطاء امتصاص الطعام مما يعطى احساس دائم بالشبع 
4-يعمل على ازالة السموم .من الجسم 
5-ليس لةطعماو رائحة ويتم اذابتةفى الماء كليا 🌸🌸🌸🌸🌸🌸🌸
مميزاتة :1-تعزيز مستويات الطاقة بالجسم 
